    false,nt"url": null,nt"notes": "A submerged topography digital elevation
    model (DEM) mosaic for a portion of the submerged environs of Crocker Reef, Florida,
    was produced from remotely sensed, geographically referenced elevation measurements
    collected on April 13 and 22, 2014 by the U.S. Geological Survey. Elevation measurements
    were collected over the area using the second-generation Experimental Advanced Airborne
    Research Lidar (EAARL-B), a pulsed laser ranging system mounted onboard an aircraft
    to measure ground elevation, vegetation canopy, and coastal topography. The system
    uses high-frequency laser beams directed at the Earth's surface through an opening
    in the bottom of the aircraft's fuselage. The laser system records the time difference
    between emission of the laser beam and the reception of the reflected laser signal
    in the aircraft. The plane travels over the target area at approximately 55 meters
    per second at an elevation of approximately 300 meters, resulting in a laser swath
    of approximately 240 meters with an average point density of 0.9 points per square
    meter. A peak sampling rate of 15u009630 kilohertz results in an extremely dense
    spatial elevation dataset. More than 100 kilometers of coastline can be surveyed
    easily within a 3- to 4-hour mission. When resultant elevation maps for an area
    are analyzed, they provide a useful tool to make management decisions regarding
    land development.",nt"license_title": null,nt"extras": [{ntt"key":
